import React from 'react';
import { Router } from '@reach/router';

import LoginRes from './components/LoginRes';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

const Dashboard = () => {
  return (
    <>
      <h1>Dashboard</h1>
    </>
  )
}

const App = () => {
  return (
    <div className="App container-fluid">
      <Router>
        {/* <LoginRes path='/' /> */}
        <LoginRes path='/' />
        <LoginRes path='/welcome' />
      </Router>
    </div>
  );
}

export default App;
